  },
  extendConfig(config, { format }) {
    if (format.startsWith('umd')) {
      config.output.fileName = 'umd/react-easy-crop[min].js'
    }
    if (format === 'esm') {
      config.output.fileName = '[name].module.js'
    }
    return config
  },
  env: {
    NODE_ENV: 'production',
  },
}

export default config

